import React from 'react';
import logo from './logo.svg';
import './Card.css';

function Card() {
    return (

        <div className="card">
            <div className="background-image" style={{ backgroundImage: 'url(https://picsum.photos/300/200)' }}></div>

            <div className="logos">
                <img src="https://cdn-icons-png.flaticon.com/512/727/727790.png" alt="Logo 1" />
                <img src="https://png.pngtree.com/png-vector/20190214/ourlarge/pngtree-vector-sun-icon-png-image_515208.jpg" alt="Logo 2" />
                <img src="image.png" alt="Logo 3" />
            </div>
            <div className="title">Título</div>
        </div>



    );
}

export default Card;
